import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  const titlez = props.expData[0].title;
  const amount = props.expData[0].amount;
  const date = props.expData[0].date;
  console.log(titlez);
  return <ExpenseItem title={titlez} amount={amount} date={date}></ExpenseItem>;
}

export default Expenses;
